def main():
    _it = iter(HEX)
    hex_list = []
    while 1:
        ch1 = next(_it, None)
        if ch1 == None:
            break

        ch2 = next(_it)
        ch = int(f'{ch1}{ch2}', 16)
        hex_list.append(ch)

    #print(hex_list)
    _b = bytes(hex_list)
    ret = pickle.loads(_b)
    #print(ret)
    print(len(_b))

    for _i in ret:
        if _i['job'] == 4:
            continue
        print(_i, '\n')

if __name__ == '__main__':
    main()